// import "./css/Privacy.css"


function Contact() {
  return (
    <div class="columns">
      <div class="column">
        <h2>Please leave us a message </h2>
        <p>We do not read anything from your computer.</p>
        <p>We do not write anything to your computer.</p>
        <p>We do not ourselves write or read 'cookies'. Cookies are little files that many web sites put on your computer, usually so that they can remember your settings next time you visit their site or to understand your interests. </p>
        <p>If you click on a link from our site to go to another web site, the owner of that other web site may have a different policy on cookies and privacy. They should publish their own policies on their web sites. </p>
        <p>We receive a statistical report (from the company we use to hold and send you the web pages) that tells us how many people visit BritishAirshows.com, how many times each page is read, and other general information about the use of the site. That report does not identify any visitor to the site. We are not able to identify any visitor to the site in any other way. </p>
      </div>

    </div>



  );
}

export default Contact;
